Storyline

With much of the world's population now an undead horde, R is a young and introspective zombie. While fighting with and feeding on a human scavenger party, R meets Julie and feels an urge to protect her. What happens next is the beginning of a strangely warm relationship that allows R to begin regaining his humanity. As this change spreads through the local undead population like a virus, Julie and R eventually have to face a larger issue when the very nature of their friendship is challenged. Caught between the paranoid human forces and the ferocious &quot;Bonies&quot;, zombies who are a mutual threat, R and Julie must find a way common bond bridge the differences each sides must overcome so that they all fight for a better world no one thought possible


